import sys,os
class Solution():
    def findSubstring(self, s, words):
        """
        :type s: str
        :type words: List[str]
        :rtype: List[int]
        """
        l_size=len(words)
        if l_size==0:
            return [0]
        #Get the k-mer length
        w_size=len(words[0])
        str_len=len(s)
        words_hash={}
        result=[]
        if w_size*l_size>str_len:
            return []
        for i in xrange(l_size):
            if not words_hash.has_key(words[i]):
                words_hash[words[i]]=1
            else:
                words_hash[words[i]]+=1
        for i in xrange(str_len-w_size+1):
            j=i+w_size
            target=s[i:j]
            working_hash={}
            count=0
            while(words_hash.has_key(target)):
                if not working_hash.has_key(target):
                    working_hash[target]=1
                else:
                    working_hash[target]+=1
                    if working_hash[target]>words_hash[target]:
                        break
                count +=1
                if count==l_size and j!=str_len:
                    result.append(i)
                    break
                if count==l_size and j==str_len:
                    result.append(i)
                    return result
                if j== str_len:
                    break
                j_start=j
                j=j+w_size
                target=s[j_start:j]
        return result

